webpackJsonp([0xe1e4bcdf92ee],{748:function(t,e){t.exports={data:{site:{siteMetadata:{docSections:{basics:["/basics/introduction/"],guides:["/guides/quick-start-guide/","/guides/create-component-guide/"],configurations:["/configurations/details/","/configurations/custom-webpack-config/","/configurations/preset-webpack/"],components:["/components/overview/","/components/globals/","/components/wingsuit/","/components/twig/","/components/presentation/"],assets:["/assets/overview/","/assets/images/","/assets/svg/","/assets/javascript/"],testing:["/testing/manual-testing/"]}}},allMarkdownRemark:{edges:[{node:{fields:{slug:"/404/"},frontmatter:{title:"",id:null}}},{node:{fields:{slug:"/assets/images/"},frontmatter:{title:"Images & Icons",id:"images"}}},{node:{fields:{slug:"/assets/overview/"},frontmatter:{title:"Overview",id:"overview"}}},{node:{fields:{slug:"/assets/svg/"},frontmatter:{title:"Svgs",id:"svg"}}},{node:{fields:{slug:"/assets/javascript/"},frontmatter:{title:"Javascript",id:"javascript"}}},{node:{fields:{slug:"/components/overview/"},frontmatter:{title:"Overview",id:"overview"}}},{node:{fields:{slug:"/components/globals/"},frontmatter:{title:"Global variables",id:"globals"}}},{node:{fields:{slug:"/components/presentation/"},frontmatter:{title:"Presentation",id:"presentation"}}},{node:{fields:{slug:"/configurations/details/"},frontmatter:{title:"Configuration",id:"details"}}},{node:{fields:{slug:"/components/twig/"},frontmatter:{title:"Twig only",id:"twig"}}},{node:{fields:{slug:"/configurations/custom-webpack-config/"},frontmatter:{title:"Custom webpack configuration",id:"custom-webpack-config"}}},{node:{fields:{slug:"/components/wingsuit/"},frontmatter:{title:"Wingsuit (UI Pattern)",id:"wingsuit"}}},{node:{fields:{slug:"/configurations/preset-webpack/"},frontmatter:{title:"Presets",id:"preset-webpack"}}},{node:{fields:{slug:"/guides/create-component-guide/"},frontmatter:{title:"Create new component",id:"create-component-guide"}}},{node:{fields:{slug:"/guides/quick-start-guide/"},frontmatter:{title:"Quickstart guide",id:"quick-start-guide"}}},{node:{fields:{slug:"/testing/manual-testing/"},frontmatter:{title:"Manual Testing",id:"manual-testing"}}},{node:{fields:{slug:"/basics/introduction/"},frontmatter:{title:"Introduction",id:"introduction"}}}]},markdownRemark:{html:'<p>Wingsuit is a design system for twig based UI components. You can develop your components independently in <a href="https://storybook.js.org/">Storybook</a>. After finalizing your component you can use the component in other apps like drupal. </p>\n<p>The <code>wingsuit.yml</code>, an extended variant of the <a href="https://ui-patterns.readthedocs.io/en/8.x-1.x/content/patterns-definition.html">ui_patterns.yml</a> is the heart of each component. </p>\n<p><b>Wingsuit uses the following configuration files to:</b></p>\n<ul>\n<li>\n<p><b>Generate Storybook stories</b><br>\nEach variant is a Storybook story. Fields and settings are editable with <a href="https://github.com/storybookjs/storybook/tree/master/addons/knobs">knobs</a>.\n\n  <a class="gatsby-resp-image-link" href="/static/knobs-bf0f434299fd02558b71441148833bce-530e2.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 109.65447154471546%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="knobs" title src="/static/knobs-bf0f434299fd02558b71441148833bce-44d6a.png" srcset="/static/knobs-bf0f434299fd02558b71441148833bce-f4799.png 173w,\n/static/knobs-bf0f434299fd02558b71441148833bce-b3b1d.png 345w,\n/static/knobs-bf0f434299fd02558b71441148833bce-44d6a.png 690w,\n/static/knobs-bf0f434299fd02558b71441148833bce-bc0f7.png 1035w,\n/static/knobs-bf0f434299fd02558b71441148833bce-b50e5.png 1380w,\n/static/knobs-bf0f434299fd02558b71441148833bce-530e2.png 1968w" sizes="(max-width: 690px) 100vw, 690px">\n    </span>\n  </span>\n  \n  </a>\n    </p>\n</li>\n<li>\n<p><b>Automatic Storybook documentation</b><br>\nA nice documentation page is created directly from the wingsuit.yml.\n\n  <a class="gatsby-resp-image-link" href="/static/docs-cca2c0b6193786014a74d8173ab4e5cb-530e2.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 109.65447154471546%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="docs" title src="/static/docs-cca2c0b6193786014a74d8173ab4e5cb-44d6a.png" srcset="/static/docs-cca2c0b6193786014a74d8173ab4e5cb-f4799.png 173w,\n/static/docs-cca2c0b6193786014a74d8173ab4e5cb-b3b1d.png 345w,\n/static/docs-cca2c0b6193786014a74d8173ab4e5cb-44d6a.png 690w,\n/static/docs-cca2c0b6193786014a74d8173ab4e5cb-bc0f7.png 1035w,\n/static/docs-cca2c0b6193786014a74d8173ab4e5cb-b50e5.png 1380w,\n/static/docs-cca2c0b6193786014a74d8173ab4e5cb-530e2.png 1968w" sizes="(max-width: 690px) 100vw, 690px">\n    </span>\n  </span>\n  \n  </a>\n    </p>\n</li>\n<li>\n<p><b>Drupal integration</b><br>\nWith the <a href="https://www.drupal.org/project/wingsuit_companion">wingsuit_companion</a> module, patterns can be used with zero configuration in drupal. </p>\n<h1 id="screenshot"><a href="#screenshot" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>SCREENSHOT</h1>\n</li>\n</ul>\n<ul>\n<li>\n<p><b>Stay in sync</b><br>\nOne big challenge for design systems is to stay in sync between apps.\nWingsuit solves this problem with a common component configuration - the <b>wingsuit.yml</b>.</p>\n</li>\n<li>\n<p><b>Frontend frameworks</b><br>\nWingsuit ships with <a href="https://tailwindcss.com/">Tailwind CSS</a> and <a href="https://github.com/alpinejs/alpine">Alpine.js</a>.\nBoth can easily be replaced with other frameworks like <a href="https://getbootstrap.com">Bootstrap 4</a> or <a href="https://get.foundation/sites/docs/">Foundation 6</a>.</p>\n</li>\n</ul>',fields:{slug:"/basics/introduction/"},frontmatter:{title:"Introduction",id:"introduction"}}},pathContext:{slug:"/basics/introduction/"}}}});
